import Link from "next/link";

const NavBar = () => {
  return (
    <nav>
      <div className="nav-wrapper #1565c0 blue darken-3">
        <Link href="/">
          <a className="brand-logo">Logo</a>
        </Link>

        <ul id="nav-mobile" className="right hide-on-med-and-down">
          <li>
            <Link href="/login">
              <a>Login</a>
            </Link>
            <Link href="/signup">
              <a>Sign Up</a>
            </Link>
            <Link href="/create">
              <a>Create</a>
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default NavBar;
